[{"location":"","page":"Home","title":"Home","text":"CurrentModule = TimetableSolver","category":"page"},{"location":"#TimetableSolver","page":"Home","title":"TimetableSolver","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TimetableSolver.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [TimetableSolver]","category":"page"},{"location":"#TimetableSolver.VariableData","page":"Home","title":"TimetableSolver.VariableData","text":"VariableData\n\nImmutable struct to store data related to divisions, variables and values, and their mappings from ints to strings.\n\nBecause the solver only works on ints.\n\nFields:\n\ndivvarval_maps::OrderedDict{Symbol,OrderedDict}:\n\nKeys are a symbol :subject or :teacher`. Values are map of ints (div)  to 2-tuple of vecs of ints (var, val).\n\ndivvarval_mapstrs::OrderedDict{Symbol,OrderedDict}:\n\nSame as div_var_val_map but with strings instead of ints.\n\nalldivs::Vector{Int}: Vector of all divs as ints.\nallvars::Vector{Int}: Vector of all vars as ints. (no :subject :teacher bifurcation)\nallvals::Vector{Int}: Vector of all vals as ints. (no :subject :teacher bifurcation)\ndivmap::OrderedDict{Int,String}: Map from div ints to strings.\nvarmap::OrderedDict{Int,String}: Map from variable ints to strings.\nvalmap::OrderedDict{Int,String}: Map from values ints to strings.\ninversedivmap::OrderedDict{String,Int}: Inverted divmap.\ninversevarmap::OrderedDict{String,Int}: Inverted varmap.\ninversevalmap::OrderedDict{String,Int}: Inverted valmap.\nschedule::Schedule: Schedule type instance.\n\n\n\n\n\n","category":"type"}]
